let { setValue, setTextValue } = ggbApplet;

let game = {
    frames: 13,
    frameTime: 75,
    cards: 3,
    coins: 2,
    board: ["card", "card", "card", "coin", "coin", null, null, null, null],
    interval: 750,
    userAnswer: { coins: 0, cards: 0 }
}

function ggbOnInit() {
    for (let i = 0; i < game.board.length; i++) setTextValue("pos" + (i + 1), game.board[i]);
    setValue("startCards", game.cards);
    setValue("startCoins", game.coins);
    setValue("example", true);
    setValue("ok", undefined);
}

function check() {
    setValue("enabled", 0);
    play();
}

async function play(example = false) {
    let { cards, coins } = game;

    if (example) setValue("ok", 2);

    while(cards > 2 || coins > 2) {
        if (cards > 2) {
            await exchangeCards();
            cards -= 3;
            coins++;
        } else {
            await exchangeCoins();
            coins -= 3;
            cards++;
        }
        await sleep(game.interval);
    }
    
    if (!example) await animateRabbit(Number(game.userAnswer.coins === coins && game.userAnswer.cards === cards));
    else setValue("ok", 3);
}

function changeUserAnswer(type, valueToAdd) {
    let newValue = game.userAnswer[type] + valueToAdd;
    if (newValue < 0 || newValue > 9) return;
    game.userAnswer[type] = newValue;
    setValue(type, newValue);
}

function restart() {
    for (let i = 0; i < game.board.length; i++) {
        let type;
        let start = animations[`hatToPos${i + 1}`](1);

        if (i < game.cards) type = "card";
        else type = "coin";

        game.board[i] = type;
        setTextValue("pos" + (i + 1), type);
        setValue("pos" + (i + 1) + "X", start.x);
        setValue("pos" + (i + 1) + "Y", start.y);
    }

    changeUserAnswer("coins", -game.userAnswer.coins);
    changeUserAnswer("cards", -game.userAnswer.cards);
    setValue("enabled", 1);
    setValue("ok", undefined);
    setValue("rabbitAnimation", 0);
}

function getFirstGame() {
    game.cards = 4;
    game.coins = 5;
    game.board = ["card", "card", "card", "card", "coin", "coin", "coin", "coin", "coin"];
    setValue("example", false);
    setValue("startCards", game.cards);
    setValue("startCoins", game.coins);
    restart();
}

function newGame() {
    let newValue = Math.floor(Math.random() * 8) + 1;
    game.cards = newValue === game.cards ? newValue + 1 : newValue;
    game.coins = 9 - game.cards;

    setValue("startCards", game.cards);
    setValue("startCoins", game.coins);
    restart();
}

async function exchangeCards() {
    for (let i = 0; i < 3; i++) {
        let cardIndex = game.board.findIndex(v => v === "card");
        game.board[cardIndex] = null;
        await moveCard(cardIndex + 1, true);
        await sleep(game.interval);
    }

    await animateMagician();
    await sleep(game.interval);

    let emptyIndex = game.board.findIndex(v => v === null);
    game.board[emptyIndex] = "coin";
    setTextValue("pos" + (emptyIndex + 1), "coin");

    await moveCard(emptyIndex + 1, false);
}

async function exchangeCoins() {
    for (let i = 0; i < 3; i++) {
        let coinIndex = game.board.findIndex(v => v === "coin");
        game.board[coinIndex] = null;
        await moveCard(coinIndex + 1, true);
        await sleep(game.interval);
    }

    await animateMagician();
    await sleep(game.interval);

    let emptyIndex = game.board.findIndex(v => v === null);
    game.board[emptyIndex] = "card";
    setTextValue("pos" + (emptyIndex + 1), "card");

    await moveCard(emptyIndex + 1, false);
}

async function moveCard(card, toHat, percent = 0) {
    while (percent <= 1) {
        let animation = animations[`hatToPos${card}`](toHat ? 1 - percent : percent);

        setValue(`pos${card}X`, animation.x);
        setValue(`pos${card}Y`, animation.y);

        percent += 1 / game.frames;
        await sleep(game.frameTime);
    }
}

async function animateMagician(percent = 0) {
    while (percent <= 1) {
        if (percent > 0.5 && sounds.magic.paused) playSFX(sounds.magic);
        setValue("mageAnimation", percent);
        percent += 1 / game.frames;
        await sleep(game.frameTime);
    }
}

async function animateRabbit(checkResult, percent = 0) {
    while (percent <= 1) {
        setValue("rabbitAnimation", percent);
        percent += 1 / game.frames;
        await sleep(game.frameTime);
    }

    if (checkResult === 1) playSFX(sounds.wow);
    else playSFX(sounds.arg);

    setValue("screaming", true);
    return animateText(checkResult);
}

async function animateText(checkResult, letters = 0) {
    let text = checkResult === 1 ? "Parabéns!" : "Há algo errado...";
    let textName = checkResult === 1 ? "texto2" : "texto3";

    while (letters <= text.length) {
        if (letters === 0) {
            setTextValue(textName, "");
            setValue("ok", checkResult);
        }

        await sleep(game.frameTime);

        if (letters === 5) setValue("screaming", false);

        setTextValue(textName, text.substring(0, ++letters));
    }
}

function playSFX(audioName) {
    audioName.currentTime = 0
    audioName.volume = 0.3
    audioName.play()
}

function sleep(ms) { return new Promise(resolve => setTimeout(resolve, ms)); }

